import React from "react";

const Card = (props) => {
  return (
    <div className={styles.card}>
      <div className="card__header">Radio</div>
      <div className="card__body">
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla iaculis
        sit amet lectus ut mattis. Class aptent taciti sociosqu ad.
      </div>
      <div className="card__footer">
        <button className="btn btn-outline">Repo</button>
      </div>
    </div>
  );
};

export default Card;
